import './App.css';
import Change from './Change.js';
import Pro from './Props.js';
import Use from './UseEffect.js';
import Navbar from './Navbar';
import Mapping from './Mapping'

function App(){

  return(
    <div>
      <Navbar />
      <h1>React practising 1</h1>
       <Change />
       <Pro name="Kingsley"/>
       <Pro stats="Developer" />
       <Use />
       <hr></hr>
       <Mapping />
     </div>
  )

}

export default App;
